import React from "react";
import { Route, BrowserRouter as Router, Switch, BrowserRouter, NavLink } from "react-router-dom";
import "./App.css";
import User from "./components/User/UserProfile";
import Header from "./components/Header/Header";
import FooterWrapper from "./components/footer/Footer";
import Banner from "./components/Banner/banner";
import Home from "./components/Home/Home";
import Sorting from "./components/sorting/sorting";
import Search from "./components/Search/serch";
import serchimage from './components/images/serch.svg'

import cartimage from "./components/images/cart.png";
import logoimage from "./components/images/logo.png";
import profileimage from "./components/images/profile.png";
const App: React.FC = () => {
  return (
    <div>
    <BrowserRouter>
    <Switch>
    <div className="header">
      <a href="#default" className="logo">
        <img src={logoimage} />
      </a>
      <div className="header-right">
        <NavLink to="#courses">courses</NavLink>
        <NavLink to="#Mywishlist">Mywishlist</NavLink>
        <NavLink to="#cart">
          <img src={cartimage} />
        </NavLink>
        <Route exact path="/profile"><User/>
          <img src={profileimage} />
        </Route>
      </div>
    </div></Switch>
      </BrowserRouter>
    </div>
  );
};

export default App;
